 * @param {*} props 
 */
const Splash = props => {

  return (
    <div className="splashDiv">
      <h1>Welcome to Can-U</h1>
      <p>This is some information describing our app blah blah blah blahblah blah blahblah blahblahblahblahblahblahblahblah blah</p>
      <Login />
    </div>
  )
}

export default Splash;
